import React, { useState, useEffect } from 'react';

const Vehicles = () => {
  const [activeCard, setActiveCard] = useState(null);
  const [currentRotation, setCurrentRotation] = useState(0);

  const vehicles = [
    {
      id: 1,
      name: "Toyota Alphard",
      type: "MPV Premium",
      price: "Rp 1.200.000",
      period: "/hari",
      image: "https://images.unsplash.com/photo-1621007947382-bb3c3994e3fb?w=400",
      features: ["7 Kursi", "Auto AC", "LED Screen", "Leather Seat"],
      badge: "POPULAR",
      discount: "15% OFF",
      specs: { power: "250HP", transmission: "Auto", fuel: "Premium" }
    },
    {
      id: 2,
      name: "BMW 3 Series",
      type: "Sedan Luxury",
      price: "Rp 900.000",
      period: "/hari",
      image: "https://images.unsplash.com/photo-1555215695-3004980ad54e?w=400",
      features: ["5 Kursi", "Sunroof", "Premium Sound", "Sport Mode"],
      badge: "LUXURY",
      discount: "10% OFF",
      specs: { power: "255HP", transmission: "8-Speed", fuel: "Premium" }
    },
    {
      id: 3,
      name: "Honda CR-V",
      type: "SUV Family",
      price: "Rp 600.000",
      period: "/hari",
      image: "https://images.unsplash.com/photo-1603584173870-7f23fdae1b7a?w=400",
      features: ["5 Kursi", "Big Trunk", "Eco Mode", "Safety System"],
      badge: "FAMILY",
      discount: "20% OFF",
      specs: { power: "190HP", transmission: "CVT", fuel: "Regular" }
    },
    {
      id: 4,
      name: "Mercedes C-Class",
      type: "Executive Sedan",
      price: "Rp 1.100.000",
      period: "/hari",
      image: "https://images.unsplash.com/photo-1563720223485-884b46ce7c9a?w=400",
      features: ["5 Kursi", "Panoramic Roof", "MBUX System", "Ambient Light"],
      badge: "ELITE",
      discount: "12% OFF",
      specs: { power: "255HP", transmission: "9G-Tronic", fuel: "Premium" }
    }
  ];

  // Auto-rotate featured vehicles
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentRotation(prev => (prev + 1) % vehicles.length);
    }, 4000);
    return () => clearInterval(interval);
  }, []);

  const getBadgeColor = (badge) => {
    const colors = {
      'POPULAR': 'from-orange-500 to-red-500',
      'LUXURY': 'from-purple-500 to-pink-500',
      'FAMILY': 'from-green-500 to-teal-500',
      'ELITE': 'from-blue-500 to-cyan-500'
    };
    return colors[badge] || 'from-gray-500 to-gray-600';
  };

  return (
    <section id="vehicles" className="section-padding relative overflow-hidden">
      {/* Background Elements */}
      <div className="absolute top-20 -left-20 w-96 h-96 bg-blue-500/5 rounded-full blur-3xl animate-float"></div>
      <div className="absolute bottom-20 -right-20 w-96 h-96 bg-purple-500/5 rounded-full blur-3xl animate-float" style={{animationDelay: '2s'}}></div>

      <div className="container-custom relative z-10">
